import "./App.css";
import Navbar from "./components/NavBar/Navbar.";
import Dashboard from "./components//Dashboard/Dashboard";
import HeroSection from "./components/HeroSection/HeroSection";

const App = () => {
  return (
    <>
      <section>
        <Navbar />
        <Dashboard />
        <HeroSection />
      </section>
    </>
  );
};

export default App;
